var formContent=new Vue({el:"#root",data:{content:[],loader:!0,filter:null,forms_types:[]},computed:{filterContent:function(){var t=this;return t.filter?t.content.filter((function(e){return-1!==e.form_name.toLowerCase().indexOf(t.filter.toLowerCase())})):t.content},filterFormsTypes(){return this.forms_types.slice(0,5)}},methods:{getDataFromServe(){var t=this;$.ajax({type:"GET",url:BASEURL+"admin/formularios/ajax_get_forms_data",data:{},dataType:"json",success:function(e){console.log(e),200==e.code&&(t.content=e.data)}}),$.ajax({type:"GET",url:BASEURL+"admin/formularios/ajax_get_forms_types",data:{},dataType:"json",success:function(e){console.log(e),200==e.code&&(t.forms_types=e.data,setTimeout(()=>{M.AutoInit()},300))}})},getFormsTypeUrl:t=>BASEURL+"admin/formularios/addData/"+t.id,getEditData:t=>BASEURL+"admin/formularios/editData/"+t.form_custom_id+"/"+t.form_content_id},mounted:function(){this.$nextTick((function(){this.getDataFromServe()}))}});